import React, { useState } from "react";
import ArchivePage from "./pages/ArchivePage";
import "./App.css";

function App() {
	const linkedinUrl = "https://www.linkedin.com/in/zackklimek"
	const githubURL = "https://www.github.com/zackklimek"

	const SAMPLE_ARTICLES = [
		{
			title: "Grid System",
			url: "https://www.react-bootstrap.github.io/layout/grid/",
			note:
				"Bootstrap’s grid system uses a series of containers, rows, and columns to layout and align content. It’s built with flexbox and is fully responsive. Below is an example and an in-depth look at how the grid comes together.",
			datetime: "2022-10-22T04:12:07.272Z",
			tags: ["JS"],
		},
		{
			title: "BBC: Elon Musk takes control of Twitter in $44bn deal",
			url: "https://www.bbc.com/news/technology-63402338",
			note:
				"The world's richest man, Elon Musk, has completed his $44bn (£38.1bn) takeover of Twitter, according to a filing with the US government.",
			datetime: "2022-10-28T04:15:37.069Z",
			tags: ["News"],
		},
		{
			title: "Google",
			url: "https://google.com",
			note: "Google search engine",
			datetime: "2022-11-03T04:16:35.291Z",
			tags: [],
		},
		{
			title: "Basketball Reference",
			url: "https://www.basketball-reference.com/",
			note: "Basketball reference",
			datetime: "2022-11-03T04:16:36.282Z",
			tags: ["Sports", "NBA", "Stats"],
		},
		{
			title: "Java Coding Style Guide",
			url: "https://www.gvsu.edu/computing/java-coding-style-guide-37.htm",
			note:
				"The size, age, and complexity of software is growing. Programmers now spend more time reading, maintaining, and enhancing code than they do writing original code.",
			datetime: "2022-11-03T04:17:21.627Z",
			tags: ["GVSU", "CS"],
		},
		{
			title: "NBA Schedule",
			url: "https://www.espn.com/nba/schedule",
			note: "ESPN 2022-23 NBA Season Schedule",
			datetime: "2022-11-03T04:17:43.152Z",
			tags: ["Sports", "Basketball"],
		},
		{
			title: "IP to Integer",
			url: "http://www.aboutmyip.com/AboutMyXApp/IP2Integer.jsp?ipAddress=200.23.16.0",
			note: "IP address to integer number calculator",
			datetime: "2022-11-03T14:17:43.152Z",
			tags: ["CS"],
		},
		{
			title: "Computer science pioneer Fred Brooks leaves legacy at IBM, UNC and in our everyday lives",
			url: "https://www.newsobserver.com/news/business/article269308332.html",
			note: "His work at IBM is just part of his legacy that ripples far beyond Research Triangle Park",
			datetime: "2022-12-01T20:59:11.559Z",
			tags: ["CS"]
		},
		{
			title: "Rolling Stone: Remembering Takeoff, The Best Rapper in Migos",
			url: "https://www.rollingstone.com/music/music-features/takeoff-migos-tribute-1234622579/",
			note: "He was “the quiet” member of the Atlanta rap group, but his demeanor belied a commanding presence",
			datetime: "2022-11-01T04:18:03.342Z",
			tags: ["Music", "Art"],
		},
		{
			title: "EU and US turn up the heat on Elon Musk over Twitter",
			url: "https://www.ft.com/content/a07ca1ae-9f9a-46ee-9457-27bb30e18ed2",
			note: "EU commissioner warns billionaire he must adhere to the rules as Janet Yellen indicates Washington could review purchase",
			datetime: "2022-11-30T04:18:03.342Z",
			tags: ["News"],
		},
		{
			title: "Al Horford 2022 NBA Playoffs Best Highlights",
			url: "https://www.youtube.com/watch?v=iHxbF8ulQTg",
			note:
				"Al Horford Highlights Watch the best of Al Horford in the 2022 NBA Playoffs as he averaged 12.0 PPG (on 52-48-78 shooting splits) to go with 9.3 RPG and 3.3 APG for the Boston Celtics (23 games played).",
			datetime: "2022-10-02T04:18:20.603Z",
			tags: ["Sports", "NBA", "Video", "NBA", "Video", "NBA", "Video"],
		}, 
	];

	const [entries, setEntries] = useState(SAMPLE_ARTICLES);
	const [searchTags, setSearchTags] = useState([]);

	const addEntryHandler = (title, url, note, tags, datetime) => {
		const articleData = {
			title: title,
			url: url,
			note: note,
			tags: tags,
			datetime: datetime,
		};
		setEntries([...entries, articleData]);
	};

	const removeEntryHandler = (date) => {
		console.log("date in app", date)
		entries.map((a) => console.log('\t'+(a.datetime === date)))

		const newArticles = entries.filter((a) => a.datetime !== date);
		console.log("Articles",entries)
		console.log("New Articles",newArticles);
		setEntries(newArticles);
	}

	const updateEntryHandler = (entry) => {
		console.log("update",entry);
		const newArticles = entries.filter((a) => a.datetime !== entry.datetime);
		newArticles.push(entry);
		setEntries(newArticles)
	}

	return (
		<div>
			<div id="header">
				<a id="header-text" href="/">
					<h2>Article-Archive</h2>
				</a>
			</div>
			<div className="mx-4">
				<ArchivePage
					addEntry={addEntryHandler}
					removeEntry={removeEntryHandler}
					updateEntry={updateEntryHandler}
					addToQueueHandler={addToQueueHandler}
					entries={entries}
					searchTags={searchTags}
					setSearchTags={setSearchTags}
				/>
			</div>
			<div id="footer">
				<p><b>Zack Klimek</b> | F22 | <a className="linkText" href={linkedinUrl}>linkedin</a> | <a className="linkText" href={githubURL}>github</a></p>
			</div>
		</div>
	);
}

export default App;
